  background-color: #161616;
  display: flex;
  flex-direction: column;
  position: relative;
  border-radius: 20px;
  height: 350px;
  width: 550px;
  margin-top: 200px;
`
const DivStamp = styled.div`
  display: flex;
  flex-direction: column;
  height: 60%;
  width: 95%;
  margin: auto;
  margin-top: 30px;
  background-color: white;
  border-radius: 20px;
`
const DivCasseteBottom = styled.div`
  width: 98%;

`

const App = () => {
  return (
    <AppContainer>
      <DivCassete>
        <DivStamp></DivStamp>
      </DivCassete>

    </AppContainer>
  );
}


export default App;
